import React, { Component } from 'react';

export default class CreateUser extends Component {

  constructor(props) {
    super(props);

    this.state = {
      name: '',
      email: '',
      date: '',
    }
  }

  onChangeName(e) {
    this.setState({
      name: e.target.value
    })
  }

  onChangeEmail(e) {
    this.setState({
      email: e.target.value
    })
  }
  onChangeDate(e) {
    this.setState({
      date: e.target.value
    })
  }
  render() {
    return (
      <div>
          <p> you are on create-user component</p>
      </div>
    );
  }
}
